import React from "react";
import Separtor from "./Separator";

const OverlapDiv=()=>{
    return(
        <div style={{
            backgroundColor:"black",
            width:"80%",
            height:"100px",
            margin:"auto",
            position:"relative"
        }}>
        <Separtor/>
        </div>
    )
}

export default OverlapDiv;
